import React from "react";

import { Img, Text, Button } from "components";
import { useNavigate } from "react-router-dom";

const LandingPageNavbar = (props) => {
  const navigate = useNavigate();

  return (
    <>
      <div className={props.className}>
        <div
          className="common-pointer flex flex-row gap-[5px] items-center justify-start pr-1.5 w-1/4 md:w-full"
          onClick={() => navigate("/landingpage")}
        >
          <Img
            src="images/img_image1.png"
            className="h-9 md:h-auto object-cover w-[37px]"
            alt="imageOne"
          />
          <Text
            className="font-helveticaneue text-black_900 text-center w-auto"
            as="h6"
            variant="h6"
          >
            {props?.waffle}
          </Text>
        </div>
        <div className="flex flex-col items-center justify-start w-auto md:w-full">
          <Text
            className="font-helveticaneue font-normal text-black_900 text-left w-auto"
            variant="body3"
          >
            {props?.product}
          </Text>
        </div>
        <div className="flex flex-col items-center justify-start w-auto md:w-full">
          <Text
            className="common-pointer font-helveticaneue font-normal text-black_900 text-left w-auto"
            variant="body3"
            onClick={() => navigate("/newsfeed")}
          >
            {props?.readnews}
          </Text>
        </div>
        <Button
          className="common-pointer bg-orange_A100 cursor-pointer font-helveticaneue font-medium min-w-[133px] py-3 rounded-[10px] text-base text-black_900 text-center w-auto"
          onClick={() => navigate("/waitlist")}
        >
          {props?.joinWaitlist}
        </Button>
      </div>
    </>
  );
};

LandingPageNavbar.defaultProps = {
  waffle: "Waffle.",
  product: "Product",
  readnews: "Read News",
  joinWaitlist: "Join waitlist",
};

export default LandingPageNavbar;
